import React from 'react'
import styles from './note.module.scss'
function Note(props) {
    const{text,date}=props;
  return (
        <article className={styles.container}>
            <p>{text}</p>
            <footer className={styles.footer}><p>{date}</p></footer>
        </article>
  )
}

export default Note
